   </extensionElements>\n      <potentialOwner>\n        <resourceAssignmentExpression>\n          <formalExpression>management</formalExpression>\n        </resourceAssignmentExpression>\n      </potentialOwner>         \n    </userTask>\n    <sequenceFlow id=\"flow2\" sourceRef=\"handleRequest\" targetRef=\"requestApprovedDecision\" />\n    \n    <exclusiveGateway id=\"requestApprovedDecision\" name=\"Request approved?\" />\n    <sequenceFlow id=\"flow3\" sourceRef=\"requestApprovedDecision\" targetRef=\"sendApprovalMail\">\n      <conditionExpression xsi:type=\"tFormalExpression\">${vacationApproved == \'true\'}</conditionExpression>\n    </sequenceFlow>\n    \n    <task id=\"sendApprovalMail\" name=\"Send confirmation e-mail\" />\n    <sequenceFlow id=\"flow4\" sourceRef=\"sendApprovalMail\" targetRef=\"theEnd1\" />\n    <endEvent id=\"theEnd1\" />\n    \n    <sequenceFlow id=\"flow5\" sourceRef=\"requestApprovedDecision\" targetRef=\"adjustVacationRequestTask\">\n      <conditionExpression xsi:type=\"tFormalExpression\">${vacationApproved == \'false\'}</conditionExpression>\n    </sequenceFlow>\n    \n    <userTask id=\"adjustVacationRequestTask\" name=\"Adjust vacation request\">\n      <documentation>\n        Your manager has disapproved your vacation request for ${numberOfDays} days.\n        Reason: ${managerMotivation}\n      </documentation>\n      <extensionElements>\n        <activiti:formProperty id=\"numberOfDays\" name=\"Number of days\" value=\"${numberOfDays}\" type=\"long\" required=\"true\"/>\n        <activiti:formProperty id=\"startDate\" name=\"First day of holiday (dd-MM-yyy)\" value=\"${startDate}\" datePattern=\"dd-MM-yyyy hh:mm\" type=\"date\" required=\"true\" />\n        <activiti:formProperty id=\"vacationMotivation\" name=\"Motivation\" value=\"${vacationMotivation}\" type=\"string\" />\n        <activiti:formProperty id=\"resendRequest\" name=\"Resend vacation request to manager?\" type=\"enum\" required=\"true\">\n          <activiti:value id=\"true\" name=\"Yes\" />\n          <activiti:value id=\"false\" name=\"No\" />\n        </activiti:formProperty>\n      </extensionElements>\n      <humanPerformer>\n        <resourceAssignmentExpression>\n          <formalExpression>${employeeName}</formalExpression>\n        </resourceAssignmentExpression>\n      </humanPerformer>  \n    </userTask>\n    <sequenceFlow id=\"flow6\" sourceRef=\"adjustVacationRequestTask\" targetRef=\"resendRequestDecision\" />\n    \n    <exclusiveGateway id=\"resendRequestDecision\" name=\"Resend request?\" />\n    <sequenceFlow id=\"flow7\" sourceRef=\"resendRequestDecision\" targetRef=\"handleRequest\">\n      <conditionExpression xsi:type=\"tFormalExpression\">${resendRequest == \'true\'}</conditionExpression>\n    </sequenceFlow>\n    \n     <sequenceFlow id=\"flow8\" sourceRef=\"resendRequestDecision\" targetRef=\"theEnd2\">\n      <conditionExpression xsi:type=\"tFormalExpression\">${resendRequest == \'false\'}</conditionExpression>\n    </sequenceFlow>\n    <endEvent id=\"theEnd2\" />\n      \n  </process>\n  \n</definitions>\n',0),('1322',1,'FixSystemFailureProcess.bpmn20.xml','1320','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<definitions id=\"definitions\" \n  xmlns=\"http://www.omg.org/spec/BPMN/20100524/MODEL\"\n  xmlns:activiti=\"http://activiti.org/bpmn\"\n  targetNamespace=\"Examples\">\n  \n  <process id=\"fixSystemFailure\" name=\"Fix system failure\">\n  \n    <startEvent id=\"theStart\" />\n    \n    <sequenceFlow id=\"flow1\" sourceRef=\"theStart\" targetRef=\"subProcess\" />\n    \n    <subProcess id=\"subProcess\">\n    \n      <startEvent id=\"subProcessStart\" />\n      <sequenceFlow id=\"flow2\" sourceRef=\"subProcessStart\" targetRef=\"subProcessFork\" />\n      \n      <parallelGateway id=\"subProcessFork\" />\n      <sequenceFlow id=\"flow3\" sourceRef=\"subProcessFork\" targetRef=\"task1\" />\n      <sequenceFlow id=\"flow4\" sourceRef=\"subProcessFork\" targetRef=\"task2\" />\n      \n    